import React, { Component } from 'react'
import axios from 'axios';

export default class GetClass extends Component {
  constructor(props){
    super(props);

    this.state={
      get:{}
    };
  }

  componentDidMount(){
    const id = this.props.params.id;

    axios.get('/get/${id}').then((res) =>{
      if(res.data){
        this.setState({
          get:res.data.get
        });
      }
    });
  }
  render() {
    return (
      <div>
        GetClass
      </div>
    )
  }
}
